import { createRouter, createWebHistory } from 'vue-router';
import TransportCompanyConversionTable from './components/TransportCompanyConversionTable.vue';
import BalanceInquiry from './components/BalanceInquiry.vue';
import ReferenceDialog from './components/ReferenceDialog.vue';

const routes = [
  {
    path: '/TransportCompanyConversionTable',
    name: 'TransportCompanyConversionTable',
    component: TransportCompanyConversionTable,
  },
  {
    path: '/BalanceInquiry',
    name: 'BalanceInquiry',
    component: BalanceInquiry,
  },
  {
    path: '/ReferenceDialog',
    name: 'ReferenceDialog',
    component: ReferenceDialog,
  },
]

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
